import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [extendibleHashingIndex, setExtendibleHashingIndex] = useState({});
    const [linearHashingIndex, setLinearHashingIndex] = useState({});

    useEffect(() => {
        axios.get('/extendible_hashing/insert', {
            params: {
                key: 'key1',
                value: 'value1'
            }
        })
        .then(response => {
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });
    }, []);

    return (
        <div>
            <h1>Extendible Hashing and Linear Hashing</h1>
            <p>Extendible Hashing Index: {JSON.stringify(extendibleHashingIndex)}</p>
            <p>Linear Hashing Index: {JSON.stringify(linearHashingIndex)}</p>
        </div>
    );
}

export default App;
